import { 
  createBrowserRouter, 
  RouterProvider, 
  Route 
} from "react-router-dom";
const router = createBrowserRouter([
  {
    path: "/",
    element: <div>this is the home page</div>,
  },
  {
    path: "/test",
    element: <div>this is test</div>,
  },
]);

function App() {
  return <div>Hello world!</div>;
}

export default App;
